import React from "react";

const Crews = (props) => {
  return (
    // <div>
    //   <span class="badge rounded-pill text-bg-primary ">Primary</span>
    <figure class="figure">
      <div style={{ marginTop: "70px"}} className="card bg-black" >
        {/* <h5 className="title text-info mb-0">{props.name} </h5> */}
        {/* <p className="description text-info mb-0">Agency:{props.agency}</p>  */}
          <figcaption class="figure-caption text-info">{props.name}</figcaption>
          <figcaption class="figure-caption">Agencey:{props.agency}</figcaption>

        <img
          src={props.image}
          className="rounded mx-auto d-block  bg-dark"
          alt="..."
          style={{ width: "400px", height: "500px" }}
        />
      </div>
      </figure>
    // {/* // </div> */}
  );
};

export default Crews;
